const axios = require("axios");
const url = "https://covid19.mathdro.id/api";

async function fetchData() {
  try {
    const response = await axios.get(url);
    const data = response.data;
    console.log(data);
  } catch (error) {
    console.log("error has occured with fetching the data");
  }
}

fetchData();
